import React from 'react'
import Question from './Question'

function GameBox (props) {
    return (
        <div>
            {props.questions.map(q => <Question text={q.text} answer={q.answer} key={props.questions.indexOf(q.text)}/>)}
        </div>
    )
}

export default GameBox
